import axios, { AxiosResponse } from 'axios';
import React from 'react';
import { IStock } from '../Models/IStock';

interface IProps{

}
interface IState{
stocks:IStock[]
errormessage:string;

}
class Employee extends React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props)
        this.state={
            errormessage:'',
            stocks:[] as IStock[]
        }

    } 

componentDidMount():void
{
    let dataURL:string="https://gist.githubusercontent.com/ms8989/b06fcbf8b090bcd9b871abae74ee64e2/raw/4b22230e511a17c343158e41e88668d18293e3c2/stock2"
    axios.get(dataURL).then((response:AxiosResponse<any>)=>
    {
       this.setState(
           {
               ...this.state,
               stocks:response.data
           }
       ) 
    }).catch((error)=>
    {
        this.setState(
            {
                ...this.state,
                errormessage:error.message

        })
        
    })
}        
    

    
    render()
   
    {
        let {stocks}=this.state
        return(
<React.Fragment>
<section>
 <div className='container mt-2'>
     <div className='row'>
         <div className='col'>
             <div className='card'>
                 <div className='card-body bg-light'>
             <h2 className='text-primary text-center' >Stocks</h2>
             <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Enim officiis illum praesentium culpa aperiam doloremque omnis corporis quas, voluptates in modi vel totam ipsum eius tempora ratione laboriosam perferendis amet id beatae accusamus, mollitia quod debitis. Harum numquam repellat earum?</p>
         </div>
         </div>
         </div>
     </div>

 </div>
 </section>
 <section>
     <div className='container mt-5'>
         <div className='row'>
             <div className='col'>
                 {/*<pre>{JSON.stringify(this.state.stocks)}</pre>*/}
                 <table className='table table-striped table-hover table-primary text-white '>
                      <thead>
                      <tr>
                        <th>StockId</th>
                        <th>StockName</th>
                        <th>StockIndustry</th>
                        <th>Symbol</th>
                        <th>Currency</th>
                        <th>StockMarket</th>
                      </tr>
                       </thead>
                       <tbody>
                            {
                           stocks.length>0 &&
                           stocks.map((stocks)=>{
                               return(
                                   <tr  key={stocks.Stockid}>
                                   <td>{stocks.Stockid.substr(stocks.Stockid.length-5)}</td>
                                       <td>{stocks.Stockid}</td>
                                       <td> {stocks.StockName}</td>
                                      <td>{stocks.StockIndustry}</td>
                                       <td>{stocks.Symbol}</td>
                                       <td>{stocks.Currency}</td>
                                       <td>{stocks.StockMarket}</td>
                                       
                                   </tr>
                               )
                           })
                            }                          
                       </tbody>
                 </table>
             </div>
         </div>
     </div>
 </section>
</React.Fragment>
        )
    }
};
export default Employee;
